public class LoopPractice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int row= 0; 
		
		while (row<10) {
			System.out.print(++row +" ");}
		System.out.println();
	

		int col=0;
		while (col<5) {
			System.out.println(++col );}
		
		
		
		
	}

}
